import Container from 'react-bootstrap/Container';

const AboutUs = () => {
    return (
        <Container>
            <div className="p-3">
                <div className="fs-2">About Us</div>
                <div>
                    <p>This is about us page.</p>

                </div>
            </div>
        </Container>
    )
}

export default AboutUs
